"use strict";app.controller("SigninFormController",["$scope","$http","$state",function(o,r,n){o.user={},o.authError=null,o.login=function(){o.authError=null,r.post("api/login.json",{email:o.user.email,password:o.user.password}).then(function(r){console.log(r),r.data.user?n.go("app.user"):o.authError="Email or Password not right"},function(o){n.go("app.user")})}}]);